import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import { FaBars, FaTimes, FaCaretDown, FaCaretUp } from "react-icons/fa";

function Navbar() {
  const [user, setUser] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [showAshaDropdown, setShowAshaDropdown] = useState(false);

  // Simplified effect without Firebase listeners
  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };

    window.addEventListener('scroll', handleScroll);
    let user = localStorage.getItem("user");
    if (user) {
      setUser(true);
    }

    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setIsMenuOpen(false);
  };

  // Modified to be more reliable
  const toggleAshaDropdown = (e) => {
    e.preventDefault();
    e.stopPropagation();
    setShowAshaDropdown(prev => !prev);
  };

  // Close dropdown when clicking outside
  useEffect(() => {
    const closeDropdown = () => {
      setShowAshaDropdown(false);
    };
    
    if (showAshaDropdown) {
      document.addEventListener('click', closeDropdown);
    }
    
    return () => {
      document.removeEventListener('click', closeDropdown);
    };
  }, [showAshaDropdown]);

  return (
    <nav className={`navbar ${isScrolled ? 'scroll-nav' : ''}`}>
      <div className="navbar-container">
        <Link to="/" className="navbar-logo" onClick={closeMenu}>
          <div className="logo-typewriter">
            <span className="typewriter-text">mediconnect</span>
            <span className="typewriter-cursor">.</span>
          </div>
        </Link>
        <button className="menu-toggle" onClick={toggleMenu} aria-label="Toggle menu">
          {isMenuOpen ? <FaTimes /> : <FaBars />}
        </button>
        <ul className={`navbar-links ${isMenuOpen ? 'active' : ''}`}>
          <li><Link to="/" onClick={closeMenu}>Home</Link></li>
          <li><Link to="/about" onClick={closeMenu}>About</Link></li>
          <li><Link to="/services" onClick={closeMenu}>Services</Link></li>
          <li>
            <a href="https://esanjeevani.mohfw.gov.in/#/" target="_blank" rel="noopener noreferrer" onClick={closeMenu}>
              Sanjeevani App
            </a>
          </li>
          {/* Asha Worker Dropdown - Fixed with correct classes */}
          <li className="dropdown-item" onClick={(e) => e.stopPropagation()}>
            <a href="#!" className="dropdown-toggle" onClick={toggleAshaDropdown}>
              Asha Worker {showAshaDropdown ? <FaCaretUp /> : <FaCaretDown />}
            </a>
            {showAshaDropdown && (
              <div className="dropdown-menu">
                <Link to="/asha-login" className="dropdown-link" onClick={closeMenu}>
                  Login
                </Link>
                <Link to="/asha-signup" className="dropdown-link" onClick={closeMenu}>
                  Register
                </Link>
                <Link to="/asha-dashboard" className="dropdown-link" onClick={closeMenu}>
                  Dashboard
                </Link>
              </div>
            )}
          </li>
          {!user && <li><Link to="/login" onClick={closeMenu}>Login</Link></li>}
          {user && (
            <>
              <li><Link to="/chatbot" onClick={closeMenu}>Chatbot</Link></li>
              <li><Link to="/video-conferencing" onClick={closeMenu}>Video Conferencing</Link></li>
              <li>
                <button
                  className="logout-btn"
                  onClick={() => {
                    window.localStorage.removeItem("user");
                    setUser(false);
                    window.location.href = "/login";
                    closeMenu();
                  }}
                >
                  Logout
                </button>
              </li>
            </>
          )}
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
